import React from 'react';

const Services = () => {
    return (
        <div>
            <section id="services">
                <div className="container my-5 py-5">
                    <div className="row">
                        <div className="col-12 justify-content-center">
                            <h3 className="fs-5 text-center">Services</h3>
                            <p className="lead  mb-4 text-center">I offer a wide range of photography services, from portraits to landscapes to event photography.
                            I'm also available for commercial photography, so if you're looking for a photographer to capture your product or business,
                            I'm your person. 
                            </p>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default Services;
